INSERT INTO `oc_comments` VALUES (1,0,0,0,'guests','system','{\"message\":\"conversation_created\",\"parameters\":[]}','system','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(2,0,0,0,'guests','changelog','## Welcome to Nextcloud Talk!\nIn this conversation you will be informed about new features available in Nextcloud Talk.','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(3,0,0,0,'guests','changelog','## New in Talk 6','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(4,0,0,0,'guests','changelog','- Microsoft Edge and Safari can now be used to participate in audio and video calls','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(5,0,0,0,'guests','changelog','- One-to-one conversations are now persistent and cannot be turned into group conversations by accident anymore. Also when one of the participants leaves the conversation, the conversation is not automatically deleted anymore. Only if both participants leave, the conversation is deleted from the server','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(6,0,0,0,'guests','changelog','- You can now notify all participants by posting \"@all\" into the chat','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(7,0,0,0,'guests','changelog','- With the \"arrow-up\" key you can repost your last message','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(8,0,0,0,'guests','changelog','- Talk can now have commands, send \"/help\" as a chat message to see if your administrator configured some','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(9,0,0,0,'guests','changelog','- With projects you can create quick links between conversations, files and other items','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(10,0,0,0,'guests','changelog','## New in Talk 7','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(11,0,0,0,'guests','changelog','- You can now mention guests in the chat','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(12,0,0,0,'guests','changelog','- Conversations can now have a lobby. This will allow moderators to join the chat and call already to prepare the meeting, while users and guests have to wait','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(13,0,0,0,'guests','changelog','## New in Talk 8','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(14,0,0,0,'guests','changelog','- You can now directly reply to messages giving the other users more context what your message is about','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(15,0,0,0,'guests','changelog','- Searching for conversations and participants will now also filter your existing conversations, making it much easier to find previous conversations','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(16,0,0,0,'guests','changelog','- You can now add custom user groups to conversations when the circles app is installed','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(17,0,0,0,'guests','changelog','## New in Talk 9','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(18,0,0,0,'guests','changelog','- Check out the new grid and call view','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(19,0,0,0,'guests','changelog','- You can now upload and drag\'n\'drop files directly from your device into the chat','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(20,0,0,0,'guests','changelog','- Shared files are now opened directly inside the chat view with the viewer apps','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(21,0,0,0,'guests','changelog','## New in Talk 10','comment','2025-02-10 19:20:19',NULL,'chat','1',NULL,NULL,NULL,'null'),(22,0,0,0,'guests','changelog','- You can now search for chats and m