tocompleted by typing a \":\"','comment','2025-02-17 00:49:30',NULL,'chat','8',NULL,NULL,NULL,'null'),(237,0,0,0,'guests','changelog','- Link various items using the new smart-picker by typing a \"/\"','comment','2025-02-17 00:49:30',NULL,'chat','8',NULL,NULL,NULL,'null'),(238,0,0,0,'guests','changelog','- Moderators can now create breakout rooms (requires the High-performance backend)','comment','2025-02-17 00:49:30',NULL,'chat','8',NULL,NULL,NULL,'null'),(239,0,0,0,'guests','changelog','- Calls can now be recorded (requires the High-performance backend)','comment','2025-02-17 00:49:30',NULL,'chat','8',NULL,NULL,NULL,'null'),(240,0,0,0,'guests','changelog','## New in Talk 17\n- Conversations can now have an avatar or emoji as icon\n- Virtual backgrounds are now available in addition to the blurred background in video calls\n- Reactions are now available during calls\n- Typing indicators show which users are currently typing a message\n- Groups can now be mentioned in chats\n- Call recordings are automatically transcribed if a transcription provider app is registered\n- Chat messages can be translated if a translation provider app is registered','comment','2025-02-17 00:49:30',NULL,'chat','8',NULL,NULL,NULL,'null'),(241,0,0,0,'guests','changelog','## New in Talk 17.1\n- **Markdown** can now be used in _chat_ messages\n- Webhooks are now available to implement bots. See the documentation for more information https://nextcloud-talk.readthedocs.io/en/latest/bot-list/\n- Set a reminder on a chat message to be notified later again','comment','2025-02-17 00:49:30',NULL,'chat','8',NULL,NULL,NULL,'null'),(242,0,0,0,'guests','changelog','## New in Talk 18\n- Use the **Note to self** conversation to take notes and share information between your devices\n- Captions allow to send a message with a file at the same time\n- Video of the speaker is now visible while sharing the screen and call reactions are animated','comment','2025-02-17 00:49:30',NULL,'chat','8',NULL,NULL,NULL,'null'),(243,0,0,0,'guests','changelog','## New in Talk 19\n- Messages can now be edited by logged-in authors and moderators for 6 hours\n- Unsent message drafts are now saved in your browser\n- Text chatting can now be done in a federated way with other Talk servers','comment','2025-02-17 00:49:30',NULL,'chat','8',NULL,NULL,NULL,'null'),(244,0,0,0,'guests','changelog','## New in Talk 20\n- Moderators can now ban accounts and guests to prevent them from rejoining a conversation\n- Upcoming calls from linked calendar events and out-of-office replacements are now shown in conversations\n- Calls can now be done in a federated way with other Talk servers (requires the High-performance backend)','comment','2025-02-17 00:49:30',NULL,'chat','8',NULL,NULL,NULL,'null'),(245,0,0,0,'guests','changelog','## New in Talk 20.1\n- Introducing the Nextcloud Talk desktop client for Windows, macOS and Linux: https://nextcloud.com/talk-desktop-install\n- Summarize call recordings and unread messages in chats with the Nextcloud Assistant\n- Improved meetings with recognizing guests invited via their email address, import of participant lists, drafts for polls and downloading call participant lists\n- Archive conversations to stay focused','comment','2025-02-17 00:49:30',NULL,'chat','8',NULL,NULL,NULL,'null'),(246,0,0,0,'guests','system','{\"message\":\"conversation_created\",\"parameters\":[]}','system','2025-02-17 00:49:30',NULL,'chat','9',NULL,NULL,NULL,'null'),(247,0,0,0,'users','anhtt','{\"message\":\"conversation_created\",\"parameters\":[]}','system','2025-02-17 00:50:57',NULL,'chat','10',NULL,NULL,NULL,'null'),(248,0,0,0,'users','anhtt','Test','comment','2025-02-17 00:51:14',NULL,'chat','10','4bad635be734007cadd84d74a05a6d6b1386c44037a7410c387b302cba18333c',NULL,NULL,'{\"can_mention_all\":true}'),(249,0,0,0,'users','huynhcntt2012','{\"message\":\"conversation_created\",\"parameters\":[]}','system','2025-02-18 03:06:49',NULL,'chat','11',NULL,NULL,NULL,'null'),(250,0,0,0,'users','huy